<script>
(()=>{var ᢏʾ̶̱͔̝̽͂̆̄́͝ͅ='ᔇˑ̴̷̫͍͖̗̐̌̂͞'&'ꓽˈ̜̖̥ͪ̅ͯ͟͡͞',ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡=-~'ܪء̧̡̩̣̤̔̍ͩ͘͜',ᓒͺ̧̼͎̪͑̍͗̈͜͟͠=ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡-~'ⴾᵔ',ʹγ̷̺̬̘ͩ̈́ͥ̀͜=ᓒͺ̧̼͎̪͑̍͗̈͜͟͠+ᓒͺ̧̼͎̪͑̍͗̈͜͟͠,ᚓˇ̢͓͎̩̒̽ͪ̕̕=ʹγ̷̺̬̘ͩ̈́ͥ̀͜*ᓒͺ̧̼͎̪͑̍͗̈͜͟͠,ܙٴ̴͇͈̺ͭ̋̇͢͠=ᓒͺ̧̼͎̪͑̍͗̈͜͟͠*ʹγ̷̺̬̘ͩ̈́ͥ̀͜*ᓒͺ̧̼͎̪͑̍͗̈͜͟͠,ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞=ᚓˇ̢͓͎̩̒̽ͪ̕̕*ʹγ̷̺̬̘ͩ̈́ͥ̀͜,ᐥˇ̸͇̼̠̐̌͊͜͢͟=ʹγ̷̺̬̘ͩ̈́ͥ̀͜*ܙٴ̴͇͈̺ͭ̋̇͢͠,ᣟͺ̨̺̜̗ͧͬ̆̋̀̕=ᚓˇ̢͓͎̩̒̽ͪ̕̕*ᓒͺ̧̼͎̪͑̍͗̈͜͟͠*ᚓˇ̢͓͎̩̒̽ͪ̕̕,ᱹʻ̸̖̤̟̐ͩ̒͆͟͡=ᐥˇ̸͇̼̠̐̌͊͜͢͟*ʹγ̷̺̬̘ͩ̈́ͥ̀͜,ˇᵕ̸̸̛̖̖̹́̊̾=ᚓˇ̢͓͎̩̒̽ͪ̕̕*ᐥˇ̸͇̼̠̐̌͊͜͢͟,ᱹᵕ̊ͥ̽̎͏̻͎̥͜͟=ʹγ̷̺̬̘ͩ̈́ͥ̀͜*ᱹʻ̸̖̤̟̐ͩ̒͆͟͡,ᐧꞈ̷̛̻̻̋ͦ̋͒̕ͅ=ᐥˇ̸͇̼̠̐̌͊͜͢͟*ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞,ⴾہ̏̐ͤ͢͝͏̥͖͙=ᱹʻ̸̖̤̟̐ͩ̒͆͟͡*ܙٴ̴͇͈̺ͭ̋̇͢͠,ᣞʺ̸̸̧̱̬̠̆̃̐=ᚓˇ̢͓͎̩̒̽ͪ̕̕*ᱹᵕ̊ͥ̽̎͏̻͎̥͜͟,ꜙꜗ̶̫̱͙̔ͤͦ̕͜=ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞*ˇᵕ̸̸̛̖̖̹́̊̾,ᠷי̢̧̮̭̖ͧ̇͐̕͡=ʹγ̷̺̬̘ͩ̈́ͥ̀͜*ᣞʺ̸̸̧̱̬̠̆̃̐,ᒢꞈ̧̪̙̥́ͥ̾͞͞=!ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡+[],ᠤۃ̨͔̦̣̊̌͒̚͘͟=ᒢꞈ̧̪̙̥́ͥ̾͞͞[ᢏʾ̶̱͔̝̽͂̆̄́͝ͅ],ᠻᵔ̯̥͎̩ͫ͐̓̎͢͠͡=ᠤۃ̨͔̦̣̊̌͒̚͘͟[ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡]+[],ᠥՙ̨͚̺̳̬̈́̅̾͘͜=ᒢꞈ̧̪̙̥́ͥ̾͞͞[ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡],މ_ﱣ=ᒢꞈ̧̪̙̥́ͥ̾͞͞[ᓒͺ̧̼͎̪͑̍͗̈͜͟͠],ᐧʻ̶͖̹͕̌ͯ̆̀͢=ᒢꞈ̧̪̙̥́ͥ̾͞͞[ᓒͺ̧̼͎̪͑̍͗̈͜͟͠+ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡],ۂꜗ̨̧̺̰̟́͐̀̚=ᒢꞈ̧̪̙̥́ͥ̾͞͞[ʹγ̷̺̬̘ͩ̈́ͥ̀͜],ۃꙿ̷̡͕̭̝̈́̅ͪͯ͟=ᠻᵔ̯̥͎̩ͫ͐̓̎͢͠͡[ʹγ̷̺̬̘ͩ̈́ͥ̀͜+ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡],ᠤ_ۣۣۣ=[]+{},ᠴՙ̖̝͍̌̔̎́̕͞=ᠤ_ۣۣۣ[ʹγ̷̺̬̘ͩ̈́ͥ̀͜+ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡],ᱼە̵̵̪͕̦̗̈ͥ̆̀͜=ᠤ_ۣۣۣ[ᓒͺ̧̼͎̪͑̍͗̈͜͟͠],ۂꜙ̻͇͇̱̇̍̇̀͘͟=ᠻᵔ̯̥͎̩ͫ͐̓̎͢͠͡[ᢏʾ̶̱͔̝̽͂̆̄́͝ͅ],ʾᶥ̷̡͕̼̺ͥ͊ͩ̕=ᠻᵔ̯̥͎̩ͫ͐̓̎͢͠͡[ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡],ᐧי̡͉̹͙̖̈́̒ͫͩ́̀͡=(!ᢏʾ̶̱͔̝̽͂̆̄́͝ͅ+[])[ᢏʾ̶̱͔̝̽͂̆̄́͝ͅ],ᛧꜗ̴̓̒ͣ͝͏̩̳̦=ᠤ_ۣۣۣ[ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡],ᖮˆ̻̗̖͑̈̌́͘͟=ᠤ_ۣۣۣ[ᚓˇ̢͓͎̩̒̽ͪ̕̕-ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡],ᚐᵔ̵̨̢̬͎̫̉̀ͤ=ᠻᵔ̯̥͎̩ͫ͐̓̎͢͠͡[ᓒͺ̧̼͎̪͑̍͗̈͜͟͠],ゝۂ̸̵̢̻̳̬̆ͯ̋=(!ᢏʾ̶̱͔̝̽͂̆̄́͝ͅ+[])[ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡],ᠥꜙ̶̝͉̩ͥ̋̔͢͡=ᠴՙ̖̝͍̌̔̎́̕͞+ᛧꜗ̴̓̒ͣ͝͏̩̳̦+ʾᶥ̷̡͕̼̺ͥ͊ͩ̕+ᐧʻ̶͖̹͕̌ͯ̆̀͢+ᐧי̡͉̹͙̖̈́̒ͫͩ́̀͡+ゝۂ̸̵̢̻̳̬̆ͯ̋+ۂꜙ̻͇͇̱̇̍̇̀͘͟+ᠴՙ̖̝͍̌̔̎́̕͞+ᐧי̡͉̹͙̖̈́̒ͫͩ́̀͡+ᛧꜗ̴̓̒ͣ͝͏̩̳̦+ゝۂ̸̵̢̻̳̬̆ͯ̋,ངꓻ̷̶̩̱̻̊̂̒̀͢ͅ=[][ᠤۃ̨͔̦̣̊̌͒̚͘͟+ۃꙿ̷̡͕̭̝̈́̅ͪͯ͟+މ_ﱣ+ᐧי̡͉̹͙̖̈́̒ͫͩ́̀͡+ۂꜗ̨̧̺̰̟́͐̀̚+ゝۂ̸̵̢̻̳̬̆ͯ̋],ᒢ_ࣻࣻࣻ=ངꓻ̷̶̩̱̻̊̂̒̀͢ͅ[ᠥꜙ̶̝͉̩ͥ̋̔͢͡],ܙʾ̵̨͉̲̤̓͛͐̔͟=''[ᠥꜙ̶̝͉̩ͥ̋̔͢͡]+[],יˈ̹̯̯̾̅͂͢͢͟=ܙʾ̵̨͉̲̤̓͛͐̔͟[ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡+ᚓˇ̢͓͎̩̒̽ͪ̕̕],ᣞˑ̶̸̷̖̪͕̔ͭ̾͟=ܙʾ̵̨͉̲̤̓͛͐̔͟[ܙٴ̴͇͈̺ͭ̋̇͢͠-ᓒͺ̧̼͎̪͑̍͗̈͜͟͠],ᔇꜙ͈̤̪̏̔͑̕͘͡=ᐧי̡͉̹͙̖̈́̒ͫͩ́̀͡+ᛧꜗ̴̓̒ͣ͝͏̩̳̦+יˈ̹̯̯̾̅͂͢͢͟+ᐧי̡͉̹͙̖̈́̒ͫͩ́̀͡+ゝۂ̸̵̢̻̳̬̆ͯ̋+ۃꙿ̷̡͕̭̝̈́̅ͪͯ͟+ʾᶥ̷̡͕̼̺ͥ͊ͩ̕+ᣞˑ̶̸̷̖̪͕̔ͭ̾͟,ەʹ̷̡̱͈̬ͬ̔̂͞͠=(ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡+ᚓˇ̢͓͎̩̒̽ͪ̕̕+ܙٴ̴͇͈̺ͭ̋̇͢͠)[ᔇꜙ͈̤̪̏̔͑̕͘͡](ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞),ᠳᵕ̱̪̠ͩͨͪ́͢͟=[][ᠥꜙ̶̝͉̩ͥ̋̔͢͡][ᠥꜙ̶̝͉̩ͥ̋̔͢͡](ゝۂ̸̵̢̻̳̬̆ͯ̋+ۂꜗ̨̧̺̰̟́͐̀̚+ᐧי̡͉̹͙̖̈́̒ͫͩ́̀͡+ۂꜙ̻͇͇̱̇̍̇̀͘͟+ゝۂ̸̵̢̻̳̬̆ͯ̋+ʾᶥ̷̡͕̼̺ͥ͊ͩ̕+ᖮˆ̻̗̖͑̈̌́͘͟+ۂꜗ̨̧̺̰̟́͐̀̚+ᐧʻ̶͖̹͕̌ͯ̆̀͢+ᠴՙ̖̝͍̌̔̎́̕͞+ᠥՙ̨͚̺̳̬̈́̅̾͘͜+ەʹ̷̡̱͈̬ͬ̔̂͞͠+ۂꜗ̨̧̺̰̟́͐̀̚)(),ᐥʽ͚̺͉͐ͫ̓͢͜͟͡=ᠳᵕ̱̪̠ͩͨͪ́͢͟(''[ᱼە̵̵̪͕̦̗̈ͥ̆̀͜+ۃꙿ̷̡͕̭̝̈́̅ͪͯ͟+ᣞˑ̶̸̷̖̪͕̔ͭ̾͟]())[ᓒͺ̧̼͎̪͑̍͗̈͜͟͠],ᠷە̛͉̮̠ͯ̓ͫ͘̕=(ܙٴ̴͇͈̺ͭ̋̇͢͠+ʹγ̷̺̬̘ͩ̈́ͥ̀͜+ᓒͺ̧̼͎̪͑̍͗̈͜͟͠)[ᔇꜙ͈̤̪̏̔͑̕͘͡](ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞),ᠶء̛̗̱͍ͣͥ̅́͘=(ܙٴ̴͇͈̺ͭ̋̇͢͠+ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡)[ᔇꜙ͈̤̪̏̔͑̕͘͡](ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞),ངʺ̴̗̫̤͋̾̒͜͠ͅ=''[ᠥꜙ̶̝͉̩ͥ̋̔͢͡][ᠤۃ̨͔̦̣̊̌͒̚͘͟+ゝۂ̸̵̢̻̳̬̆ͯ̋+ᛧꜗ̴̓̒ͣ͝͏̩̳̦+ᠷە̛͉̮̠ͯ̓ͫ͘̕+ᐥʽ͚̺͉͐ͫ̓͢͜͟͡+ᠶء̛̗̱͍ͣͥ̅́͘+ᠥՙ̨͚̺̳̬̈́̅̾͘͜+ゝۂ̸̵̢̻̳̬̆ͯ̋+ᐥʽ͚̺͉͐ͫ̓͢͜͟͡+ᛧꜗ̴̓̒ͣ͝͏̩̳̦+ᚐᵔ̵̨̢̬͎̫̉̀ͤ+ۂꜗ̨̧̺̰̟́͐̀̚],ᓪꜚ̧̡̛͍̼͙̃̽̓ͫ͡=ᐥˇ̸͇̼̠̐̌͊͜͢͟+ܙٴ̴͇͈̺ͭ̋̇͢͠+ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡+ᓒͺ̧̼͎̪͑̍͗̈͜͟͠,ᐦꓸ̴̴̴͖͈̼͊̉̂̚=ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞+ܙٴ̴͇͈̺ͭ̋̇͢͠,ᖦꓼ̷̨͖̙͇̞̍̾̒͆͘͞=ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡+ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞,ⴰᵔ̸̩͖̖ͩ̍̊ͬ͜͝=ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞+ᚓˇ̢͓͎̩̒̽ͪ̕̕+ᓒͺ̧̼͎̪͑̍͗̈͜͟͠+ܙٴ̴͇͈̺ͭ̋̇͢͠,ᚑʽ̭̬͖̼ͪͩ̐͠͝͞=ᐥˇ̸͇̼̠̐̌͊͜͢͟+ᚓˇ̢͓͎̩̒̽ͪ̕̕+ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞+ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡+ᓒͺ̧̼͎̪͑̍͗̈͜͟͠,ᠤͺ̶̞̤̻͎̿̔̾́͡=ܙٴ̴͇͈̺ͭ̋̇͢͠+ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡+ʹγ̷̺̬̘ͩ̈́ͥ̀͜+ᓒͺ̧̼͎̪͑̍͗̈͜͟͠+ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞,ᠰˇ̸̨̜̬͈̔͐ͦ̃͢=ܙٴ̴͇͈̺ͭ̋̇͢͠+ᓒͺ̧̼͎̪͑̍͗̈͜͟͠+ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡+ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞+ᐥˇ̸͇̼̠̐̌͊͜͢͟,ۀʿ̞̲̼̺͂̋̏ͩ͘͢͟͞=ᚓˇ̢͓͎̩̒̽ͪ̕̕+ʹγ̷̺̬̘ͩ̈́ͥ̀͜+ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞+ܙٴ̴͇͈̺ͭ̋̇͢͠+ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡,ヽꓻ̸̷͉̭͎ͨ͌͐͠=ʹγ̷̺̬̘ͩ̈́ͥ̀͜+ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞+ᚓˇ̢͓͎̩̒̽ͪ̕̕,ꙿʽ̧̛̳̱̦͚̓ͫ̐ͣ́͢=ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡+ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞+ᓒͺ̧̼͎̪͑̍͗̈͜͟͠+ʹγ̷̺̬̘ͩ̈́ͥ̀͜+ᐥˇ̸͇̼̠̐̌͊͜͢͟+ܙٴ̴͇͈̺ͭ̋̇͢͠,ⵗꙿ̣̭͈̃ͯ̄̚͘͜͢͠=ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞+ᚓˇ̢͓͎̩̒̽ͪ̕̕,ⵈꞈ̵̸̡̞̬̠͂̇̑ͬ͢=ᓒͺ̧̼͎̪͑̍͗̈͜͟͠+ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡+ᚓˇ̢͓͎̩̒̽ͪ̕̕+ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞+ܙٴ̴͇͈̺ͭ̋̇͢͠+ʹγ̷̺̬̘ͩ̈́ͥ̀͜,މꓸ̢̙͇̼̄̓̃́͟=ᚓˇ̢͓͎̩̒̽ͪ̕̕+ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞+ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡,ߑᵕ̖̯̖͉͊̍̂́̕͝=ᐥˇ̸͇̼̠̐̌͊͜͢͟+ܙٴ̴͇͈̺ͭ̋̇͢͠+ᚓˇ̢͓͎̩̒̽ͪ̕̕+ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞,ᡃٴ̛̼̳̘̄̆̌ͣ̀́͢=ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡+ᐥˇ̸͇̼̠̐̌͊͜͢͟+ᚓˇ̢͓͎̩̒̽ͪ̕̕,ᒢ_ؖؖ=ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡+ᐥˇ̸͇̼̠̐̌͊͜͢͟+ܙٴ̴͇͈̺ͭ̋̇͢͠+ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞+ʹγ̷̺̬̘ͩ̈́ͥ̀͜,ㆵꞈ̧̨̧̩̩̝͌ͩ͌ͬ͢=ᐥˇ̸͇̼̠̐̌͊͜͢͟+ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡+ʹγ̷̺̬̘ͩ̈́ͥ̀͜+ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞,יہ̈́̀ͭ͏̷̷̯̩̺͟=ܙٴ̴͇͈̺ͭ̋̇͢͠+ᓒͺ̧̼͎̪͑̍͗̈͜͟͠+ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞+ᐥˇ̸͇̼̠̐̌͊͜͢͟,ᕐꓺ̶̥̣͈̖̽̌ͭ́̀͜=ᚓˇ̢͓͎̩̒̽ͪ̕̕+ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞+ᐥˇ̸͇̼̠̐̌͊͜͢͟+ʹγ̷̺̬̘ͩ̈́ͥ̀͜+ܙٴ̴͇͈̺ͭ̋̇͢͠,ངʺ̛̰̘̜̬ͯ̃͗̏̀͢=ʹγ̷̺̬̘ͩ̈́ͥ̀͜+ᚓˇ̢͓͎̩̒̽ͪ̕̕+ᢤꜚ͕̙͍͎ͤ̎̆̀͢͡+ᐥˇ̸͇̼̠̐̌͊͜͢͟+ܙٴ̴͇͈̺ͭ̋̇͢͠,ءꓸ̢̛̪̬̝ͨ̿ͯ͞=ᓒͺ̧̼͎̪͑̍͗̈͜͟͠+ހꓸ̒͒ͪ͗͏̨̠͓̭͘͞+ᐥˇ̸͇̼̠̐̌͊͜͢͟+ᚓˇ̢͓͎̩̒̽ͪ̕̕+ʹγ̷ͩ̈́ͥ̀͜
